    min_val = float('inf')
    max_val = float('-inf')
    for num in lst:
        if num >= rng[0] and num <= rng[1]:
            if num < min_val and num % 3 == 0:
                min_val = num
            if num > max_val and is_prime(num):
                max_val = num
    return max_val if max_val > min_val else None

